package com.orange.cas.entity;import com.orange.core.base.dao.page.QueryModel;public class KeyValueEntity extends QueryModel{	private static final long serialVersionUID = 1L;	private String keys;	private String value;	public void clear() {		super.clear();		keys = null;		value = null;	}	public String getKeys() {		return keys;	}	public void setKeys(String keys) {		this.keys = keys;	}	public String getValue() {		return value;	}	public void setValue(String value) {		this.value = value;	}}